def transform_name(input_list):
    output_list = []
    for name in input_list:
        if len(name) > 0:
            first_last = name[0].split(',')
            if len(first_last) == 2:
                transformed_name = [first_last[1], first_last[0]]
                output_list.append(transformed_name)
    return output_list

# Example usage:
input_list = [['Stewart,Bob']]
output_list = transform_name(input_list)
print(output_list)
